package com.ramon.catchup.repository;


import static org.assertj.core.api.Assertions.assertThat;

import java.io.IOException;
import java.time.LocalDate;
import java.util.Optional;

import org.junit.Test;
import org.junit.runner.RunWith;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.autoconfigure.jdbc.AutoConfigureTestDatabase;
import org.springframework.boot.test.autoconfigure.jdbc.AutoConfigureTestDatabase.Replace;
import org.springframework.boot.test.autoconfigure.orm.jpa.DataJpaTest;
import org.springframework.boot.test.autoconfigure.orm.jpa.TestEntityManager;
import org.springframework.test.context.ActiveProfiles;
import org.springframework.test.context.junit4.SpringRunner;

import com.ramon.catchup.domain.Aviso;
import com.ramon.catchup.util.ConvertDate;
import com.ramon.catchup.util.Imagem;



@RunWith(SpringRunner.class)
@DataJpaTest
@AutoConfigureTestDatabase(replace = Replace.NONE)
@ActiveProfiles("test")
public class AvisoRepositoryTest {

	@Autowired
	private AvisoRepository repository;

	@Autowired
	TestEntityManager entityManager;

	@Test
	public void deveSalvarUmaAviso() {
		Aviso aviso = null;
		try {
			aviso = criarAviso();
			persistirClassesDependentes(aviso);
			
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

		aviso = repository.save(aviso);

		assertThat(aviso.getId()).isNotNull();

	}

	private void persistirClassesDependentes(Aviso aviso) {
		entityManager.persist(aviso.getUsuario().getFilial());
		entityManager.persist(aviso.getUsuario());
	}

	@Test
	public void deveBuscarUltimoAviso() {
		Aviso aviso = null;
		try {
			aviso = criarAviso();
			persistirClassesDependentes(aviso);
			aviso.setTitulo("aviso que nao deve aparecer");
			entityManager.persist(aviso);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

		
		Aviso aviso2 = null;
		try {
			aviso2 = criarAviso();
			persistirClassesDependentes(aviso2);
			entityManager.persist(aviso2);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

		
		Optional<Aviso> avisoopt = repository.findTopByOrderByIdDesc();

		assertThat(avisoopt).isPresent();
		assertThat(avisoopt.get().getTitulo()).contains("titulo teste");
			

	}

	@Test
	public void naoBuscarUmaAviso() {

		Optional<Aviso> avisoopt = repository.findTopByOrderByIdDesc();

		assertThat(avisoopt).isEmpty();	

	}

	
	public static Aviso criarAviso() throws IOException {
		
		return Aviso.builder()
				.dataCadastro(ConvertDate.localDateToDate(LocalDate.now()))
				.descricao("aviso aomdoemove al,owmo eckmeom oqso memc o moamowmdo emocm eoamoeco amowcmwo")
				.titulo("titulo teste")
				.imagem(Imagem.converterFotoBase64ToArrayByte(""))
				.usuario(UsuarioRepositoryTest.criarUsuario())
				.build();
	}

}
